@Maxipack: I can't speak for Disc 1 but I got that issue with Disc 2, I downloaded just disc 2 cause I bought the game but lost my disc 1. I tried again and I downloaded this one: http://thepiratebay.org/tor/3536572/MicrosofFlighSimulator_X_Deluxe-Razor1911_(_DVD1_REPACKED). Problem solved with that torrent, so I suggest redownloading that one.

FYI: Anyone with issues when it says "please insert disc 2" this is because you don't have the 2nd disc in the same drive letter as when you started the install. The install doesn't look for the disc anywhere else.

